import React, { Component } from 'react';


import Aluno from './aluno.svg';
class SideMenuDashbaord extends Component {
    render = () => {
        return (
            <div style={{
                width: 200,
                height: '100%',
                backgroundColor: '#F1F1F1',
                alignItems: 'center',
                justifyContent: 'center',
                display: 'flex'
            }}>

                <div style={{
                    alignItems: 'center',
                    display: 'flex',
                    justifyContent: 'center',
                    flexDirection: 'column',
                    marginBottom: 32,
                }} >
                    <img src={require("./aluno.svg")}></img>
                    <p style={{
                        fontFamily: 'Sofia',
                        fontStyle: 'normal',
                        fontWeight: 'normal',
                        color: 'black'
                    }}>Aline Machado</p>
                    <p style={{ fontFamily: "Dosis", margin: 0 }}>9ยบ Ano,  Turma C</p>
                    <div style={{
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'center',
                        flexDirection: 'row',
                    }}>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                        <img style={{ margin: 6, display: 'flex', flex: 1 }} src={require("./star.svg")}></img>
                    </div>
                </div>

            </div >


        )
    }
}

export default SideMenuDashbaord;
